description:
She can be your sweetest dream... and your worst nightmare!
After being released from her wrongful incarceration, Maxine Cady (Bonnie Rotten) is out for revenge. Convinced her lawyer, Samantha Bowden (Chanel Preston), is to blame, she focuses her terrorizing rampage on her and her family. As this thrilling, erotic tale keeps you on the edge of your seat, you're left wondering whether you should root for Samantha or Max... Whose side are you on?

Bonnie Rotten,Chanel Preston,Jodi Taylor,Luna Star,Evan Stone,Alec Knight,Tommy Pistol,Jimmy Broadway,Jack Spade

